import React from 'react';
import ReactDOM from 'react-dom/client';
import { Routes, Route, BrowserRouter, Link } from 'react-router-dom';
import './index.css';
import Text from './components/text';
import { Card, CardHeader, CardTitle, CardFooter } from './components/card';
import { Button } from "./components/button"

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <div className='bg-base flex flex-col items-center m-auto gap-8 h-screen'>
        <nav>
          <ul className='flex gap-2'>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/text">Text</Link></li>
            <li><Link to="/card">Card</Link></li>
          </ul>
        </nav>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/text" element={<Text />} />
          <Route path="/card" element={<CardExample />} />
          <Route path="/button" element={<ButtonDemo />} />

        </Routes>
      </div>
    </BrowserRouter>
  </React.StrictMode>
);






function Home() {

  return (
    <div>
      <h1> welcome home!!!!</h1>
    </div>
  )


}


function CardExample() {
  return (
    <div className='grid gap-4 lg:grid-cols-4 auto-rows-fr w-full '>
    <Card>
      <CardHeader>Hello from my nice card</CardHeader>
      <CardTitle>title of my card</CardTitle>
      <CardFooter>hello from Footer</CardFooter>
    </Card>
    </div>

  )
}

function ButtonDemo() {
  return <Button>Button</Button>
}
